script: |
  super -f text -I q1618.spq | sort > q1618.out

inputs:
  - name: q1618.spq
    data: |
      SELECT DISTINCT 84 AS col1 FROM tab1 (FORMAT parquet) WHERE + - ( + + 94 ) < - + col1 + col2 + + - 83 / - ( + ( col2 ) ) + 92 * + + col1;
  - name: tab1

outputs:
  - name: q1618.out
    data: |
      84
